import React from 'react'
import { useHistory } from "react-router-dom";
import {useAuth} from '../App/AppContext'

export const Dashboard = () => {
return (
    <h3>
    Dashboard
    <AuthButton/>
    </h3>
)
}

function AuthButton() {
    let history = useHistory();
    let auth = useAuth();

return auth.user ? (
    <p>
    Welcome!{" "}
    <button
        onClick={() => {
        auth.signout(() => history.push("/"));
        }}
    >
        Sign out
    </button>
    </p>
) : (
    <p>You are not logged in.</p>
);
}
